import React from 'react'
import useSound from 'use-sound'
import clickSound from '../sounds/click_1.mp3'

const CloseBtn = (props) => {

  const [play] = useSound(
    clickSound,
    { volume: 0.25 }
  )

  return (
    <div className="xClose" onClick={() => { props.goBack; this.props.onClick; this.play()}}>x</div>
  );
}
export default CloseBtn
